  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Prime
  Hook National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, croplands,
  grasslands, fire management, and pest control. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, game mammals, and marking and bird banding.
  The public uses of the Refuge described in this report include outdoor classrooms,
  hunting, fishing, wildlife observation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  equipment replacement, and communication systems. Cooperative programs and items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
